import React from 'react'
import Button from 'react-bootstrap/Button'
import styles from './SpouseForm.module.css';
export default function SpouseForm(props) {
    return (
        <div>
            <h1 className={styles.header}>Do you have a spouse or partner?</h1>
            <ButtonGroup size="lg" className="mb-2">
                <Button>Left</Button>
                <Button>Middle</Button>
                <Button>Right</Button>
            </ButtonGroup>
            <Button className={styles.buttonWidth} variant="outline-primary" size="lg" >Yes</Button>{' '}
            <Button className={styles.buttonWidth} variant="outline-primary" size="lg" >No</Button>{' '}
        </div>
    )
}
